        void CbufBO2(string command)
        {
            ct2.CallVoid(0x824015E0, new object[] { 0, command });
        }

        private string BO2ReturnMapname(string map)
        {
            switch (map)
            {
                //Standard Maps
                case "Aftermath": return "mp_aftermath";
                case "Cargo": return "mp_dockside";
                case "Carrier": return "mp_carrier";
                case "Drone": return "mp_drone";
                case "Express": return "mp_express";
                case "Hijacked": return "mp_hijacked";
                case "Meltdown": return "mp_meltdown";
                case "Nuketown": return "mp_nuketown_2020";
                case "Overflow": return "mp_overflow";
                case "Plaza": return "mp_nightclub";
                case "Raid": return "mp_raid";
                case "Slums": return "mp_slums";
                case "Standoff": return "mp_village";
                case "Turbine": return "mp_turbine";
                case "Yemen": return "mp_socotra";

                //DLC Maps
                case "Cove": return "mp_Cove";
                case "Dig": return "mp_dig";
                case "Downhill": return "mp_downhill";
                case "Detour": return "mp_Detour";
                case "Encore": return "mp_concert";
                case "Frost": return "mp_frostbite";
                case "Grind": return "mp_skate";
                case "Hydro": return "mp_hydro";
                case "Magma": return "mp_magma";
                case "Mirage": return "mp_mirage";
                case "Pod": return "mp_pod";
                case "Rush": return "mp_rush";
                case "Studio": return "mp_studio";
                case "Takeoff": return "mp_takeoff";
                case "Uplink": return "mp_uplink";
                case "Verigo": return "mp_vertigo";
            }
            return "mp_aftermath";
        }

        private void setgamertag(string gt)
        {
            ct2.SetMemory(0x82C55D00, new byte[] { 0x7C, 0x83, 0x23, 0x78, 0x3D, 0x60, 0x82, 0xC5, 0x38, 0x8B, 0x5D, 0x60, 0x3D, 0x60, 0x82, 0x4A, 0x39, 0x6B, 0xDC, 0xA0, 0x38, 0xA0, 0x0, 0x20, 0x7D, 0x69, 0x3, 0xA6, 0x4E, 0x80, 0x4, 0x20 });
            ct2.SetMemory(0x8293D724, new byte[] { 0x3D, 0x60, 0x82, 0xC5, 0x39, 0x6B, 0x5D, 0x0, 0x7D, 0x69, 0x3, 0xA6, 0x4E, 0x80, 0x4, 0x20 });
            ct2.SetMemory(0x8259B6A7, new byte[1]);
            ct2.SetMemory(0x822D1110, new byte[] { 0x40 });
