        void CalzoneClassesBO2()
        {
            ct2.SetMemory(0x843546B2, new byte[] { 0x44, 0x80, 8, 0x10, 1, 0x22, 0x40, 4 });
            {
                CbufBO2("setStatFromLocString cacloadouts customclassname 0 ^5Modded");
                CbufBO2("setStatFromLocString cacloadouts customclassname 1 ^6Classes");
                CbufBO2("setStatFromLocString cacloadouts customclassname 2 ^1Done");
