                CbufBO2("setStatFromLocString cacloadouts customclassname 8 ^5We Don't Pay");
                CbufBO2("setStatFromLocString cacloadouts customclassname 9 ^2For Shit Here");
                ct2.CallVoid(0x824015E0, new object[] { 0, "setStatFromLocString custommatchcacloadouts customclassname 0 " + "\"^1Classes" + "\"" });
                ct2.CallVoid(0x824015E0, new object[] { 0, "setStatFromLocString custommatchcacloadouts customclassname 1 " + "\"^2Done" + "\"" });
                ct2.CallVoid(0x824015E0, new object[] { 0, "setStatFromLocString custommatchcacloadouts customclassname 2 " + "\"^3With" + "\"" });
