                ct2.CallVoid(0x824015E0, new object[] { 0, "setStatFromLocString custommatchcacloadouts customclassname 4 " + "\"^5Multi-Tool" + "\"" });
                ct2.CallVoid(0x824015E0, new object[] { 0, "setStatFromLocString leaguecacloadouts customclassname 0 " + "\"^1Classes" + "\"" });
                ct2.CallVoid(0x824015E0, new object[] { 0, "setStatFromLocString leaguecacloadouts customclassname 1 " + "\"^2Done" + "\"" });
                ct2.CallVoid(0x824015E0, new object[] { 0, "setStatFromLocString leaguecacloadouts customclassname 2 " + "\"^3With" + "\"" });
                ct2.CallVoid(0x824015E0, new object[] { 0, "setStatFromLocString leaguecacloadouts customclassname 3 " + "\"^4Big Boy" + "\"" });
